drug.absorption:
Following oral administration of tetrabenazine, the extent of absorption is at least 75%.  After single oral doses ranging from 12.5 to 50 mg, plasma concentrations of tetrabenazine are generally below the limit of detection because of the rapid and extensive hepatic metabolism of tetrabenazine. Food does not affect the absorption of tetrabenazine. 
Cmax, oral = 4.8 ng/mL in HD or tardive dyskinesia patients;  
Tmax, oral = 69 min in HD or tardive dyskinesia patients
